        long long int s = 0;
        for (int j = 0; j < n; ++j) {
            cin >> a;
            s += a;
            if (s % 2 != 0) {
                ans.push_back(j + 1);
                s = 0;
            }
        }
        if (ans.back() != n || ans.size() < k) {
            cout << "NO\n";
