['#include <iostream>
#include <string>
#include <algorithm>
#include <math.h>
#include <vector>
#include <set>
#include <utility>
using namespace std;

typedef long long int ll;
typedef pair<int, int> pii;
typedef pair<long long int, long long int> pll;

#define forn(i, n) for(int i=0; i<n; i++)
#define forne(i, n) for(int i=1; i<=n; i++)

void solve(){
    int n, k; cin >> n >> k;
    vector<int> ans;
    forn(i, n){
        int a; cin >> a;
        if(a & 1)
            ans.push_back(i+1);
    }
    if(!ans.empty()){
        ans.pop_back();
        ans.push_back(n);
    }
    if(ans.size() >= k && !((ans.size()-k)&1)){
        cout << "YES" << endl;
        for(int i=ans.size()-k; i<ans.size(); i++) cout << ans[i] << " ";
        cout << endl;
    }
    else
        cout << "NO" << endl;
}

int main(){
    ios::sync_with_stdio(0);
    cin.tie(0);

    int t;
    cin >> t;
    for(int i=0; i<t; i++)
        solve();
    return 0;
}
